import React from "react";
import "./FaceRecognition.css";

const FaceRecognition = ({ imageUrl, box }) => {
	return (
		<div className="border center f4 br4 pa4">
			<img id="inputimage" alt="" src={imageUrl} width="650px" height="auto" />
			<div
				className="bounding-box"
				style={{
					top: box.topRow,
					right: box.rightCol,
					bottom: box.bottomRow,
					left: box.leftCol,
				}}
			></div>
		</div>
	);
};

export default FaceRecognition;
